import React from 'react';
import {Box, Stack, Typography} from '@mui/material';

const HeroBanner = () => {
  return (
    <Box>
        <Typography color="#FF2625" fontWeight="600"
        fontsize="26px">Fitness Club</Typography>
    </Box>
  )
}

export default HeroBanner
